-- Create the database
CREATE DATABASE IF NOT EXISTS marketing_tool;
USE marketing_tool;

-- =================================================================
-- TABLE DEFINITIONS
-- =================================================================

-- 🎯 INFLUENCERS
CREATE TABLE IF NOT EXISTS influencers (
    id INT AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(100) NOT NULL,
    category VARCHAR(50) NOT NULL CHECK (category IN ('fitness', 'nutrition', 'lifestyle', 'wellness', 'sports')),
    gender CHAR(1) CHECK (gender IN ('M', 'F')),
    follower_count INT NOT NULL CHECK (follower_count > 0),
    platform VARCHAR(20) NOT NULL CHECK (platform IN ('Instagram', 'YouTube', 'Twitter', 'LinkedIn')),
    tier VARCHAR(20) NOT NULL CHECK (tier IN ('Micro', 'Macro', 'Mega')),
    avg_engagement_rate DECIMAL(5,2) DEFAULT 0.00,
    join_date DATETIME DEFAULT CURRENT_TIMESTAMP,
    is_active BOOLEAN DEFAULT TRUE,
    email VARCHAR(150) UNIQUE,
    phone VARCHAR(15),
    location VARCHAR(100)
);

-- 📝 POSTS
CREATE TABLE IF NOT EXISTS posts (
    id INT AUTO_INCREMENT PRIMARY KEY,
    influencer_id INT NOT NULL,
    platform VARCHAR(20) NOT NULL,
    post_date DATE NOT NULL,
    post_url VARCHAR(500),
    caption TEXT,
    post_type VARCHAR(20) DEFAULT 'image' CHECK (post_type IN ('image', 'video', 'carousel', 'story', 'reel')),
    reach INT NOT NULL CHECK (reach >= 0),
    impressions INT DEFAULT 0 CHECK (impressions >= 0),
    likes INT NOT NULL CHECK (likes >= 0),
    comments INT NOT NULL CHECK (comments >= 0),
    shares INT DEFAULT 0 CHECK (shares >= 0),
    saves INT DEFAULT 0 CHECK (saves >= 0),
    engagement_rate DECIMAL(5,2) GENERATED ALWAYS AS 
        (CASE WHEN reach > 0 THEN ROUND((likes + comments + shares + saves) / reach * 100, 2) ELSE 0 END) STORED,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (influencer_id) REFERENCES influencers(id) ON DELETE CASCADE
);

-- 📦 TRACKING DATA
CREATE TABLE IF NOT EXISTS tracking_data (
    id INT AUTO_INCREMENT PRIMARY KEY,
    source VARCHAR(50) NOT NULL DEFAULT 'influencer',
    campaign VARCHAR(100) NOT NULL,
    influencer_id INT,
    user_id VARCHAR(50),
    customer_segment VARCHAR(30) DEFAULT 'new',
    product VARCHAR(100) NOT NULL,
    product_category VARCHAR(50),
    brand VARCHAR(50) NOT NULL CHECK (brand IN ('MuscleBlaze', 'HKVitals', 'Gritzo', 'HealthKart')),
    platform VARCHAR(20),  -- ✅ added this so views using t.platform work
    order_date DATE NOT NULL,
    order_value DECIMAL(10,2) NOT NULL CHECK (order_value >= 0),
    quantity INT DEFAULT 1 CHECK (quantity > 0),
    orders INT DEFAULT 1 CHECK (orders >= 0),
    revenue DECIMAL(10,2) NOT NULL CHECK (revenue >= 0),
    discount_applied DECIMAL(10,2) DEFAULT 0.00 CHECK (discount_applied >= 0),
    attribution_window INT DEFAULT 14 CHECK (attribution_window IN (7, 14, 30)),
    conversion_type VARCHAR(20) DEFAULT 'purchase' CHECK (conversion_type IN ('view', 'click', 'add_to_cart', 'purchase')),
    traffic_source VARCHAR(50),
    device_type VARCHAR(20) DEFAULT 'mobile',
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (influencer_id) REFERENCES influencers(id) ON DELETE SET NULL
);

-- 💸 PAYOUTS
CREATE TABLE IF NOT EXISTS payouts (
    id INT AUTO_INCREMENT PRIMARY KEY,
    influencer_id INT NOT NULL,
    campaign VARCHAR(100) NOT NULL,
    payout_basis VARCHAR(20) NOT NULL CHECK (payout_basis IN ('per_post', 'per_order', 'per_click', 'hybrid', 'fixed')),
    base_rate DECIMAL(10,2) NOT NULL CHECK (base_rate >= 0),
    commission_rate DECIMAL(5,2) DEFAULT 0.00 CHECK (commission_rate >= 0),
    orders_attributed INT DEFAULT 0 CHECK (orders_attributed >= 0),
    revenue_attributed DECIMAL(10,2) DEFAULT 0.00 CHECK (revenue_attributed >= 0),
    total_payout DECIMAL(10,2) NOT NULL CHECK (total_payout >= 0),
    bonus_amount DECIMAL(10,2) DEFAULT 0.00 CHECK (bonus_amount >= 0),
    payout_date DATE,
    payment_status VARCHAR(20) DEFAULT 'pending' CHECK (payment_status IN ('pending', 'approved', 'processed', 'paid', 'cancelled')),
    payment_method VARCHAR(30) DEFAULT 'bank_transfer',
    invoice_number VARCHAR(50),
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    FOREIGN KEY (influencer_id) REFERENCES influencers(id) ON DELETE CASCADE
);

-- =================================================================
-- INDEXES
-- =================================================================

CREATE INDEX idx_posts_influencer_date ON posts(influencer_id, post_date DESC);
CREATE INDEX idx_posts_platform_date ON posts(platform, post_date DESC);
CREATE INDEX idx_tracking_campaign_date ON tracking_data(campaign, order_date DESC);
CREATE INDEX idx_tracking_influencer_date ON tracking_data(influencer_id, order_date DESC);
CREATE INDEX idx_tracking_brand_product ON tracking_data(brand, product);
CREATE INDEX idx_payouts_campaign_influencer ON payouts(campaign, influencer_id);
CREATE INDEX idx_payouts_status_date ON payouts(payment_status, payout_date);
CREATE INDEX idx_roas_calculation ON tracking_data(campaign, influencer_id, revenue);

-- =================================================================
-- VIEWS
-- =================================================================

-- 🎯 View: Campaign Performance Summary
CREATE OR REPLACE VIEW v_campaign_performance AS
SELECT 
    t.campaign,
    COUNT(DISTINCT t.influencer_id) AS influencer_count,
    COUNT(DISTINCT t.user_id) AS unique_customers,
    SUM(t.orders) AS total_orders,
    SUM(t.revenue) AS total_revenue,
    ROUND(AVG(t.order_value), 2) AS avg_order_value,
    COUNT(DISTINCT DATE(t.order_date)) AS campaign_days,
    MIN(t.order_date) AS campaign_start,
    MAX(t.order_date) AS campaign_end
FROM tracking_data t
GROUP BY t.campaign;

-- 🔍 View: Influencer Performance
CREATE OR REPLACE VIEW v_influencer_performance AS
SELECT 
    i.id,
    i.name,
    i.tier,
    i.platform,
    i.category,
    COALESCE(p.total_posts, 0) AS total_posts,
    COALESCE(p.avg_engagement_rate, 0) AS avg_engagement_rate,
    COALESCE(t.campaigns_participated, 0) AS campaigns_participated,
    COALESCE(t.total_revenue_generated, 0) AS total_revenue_generated,
    COALESCE(t.total_orders_driven, 0) AS total_orders_driven,
    COALESCE(py.total_earned, 0) AS total_earned
FROM influencers i
LEFT JOIN (
    SELECT influencer_id, COUNT(*) AS total_posts, AVG(engagement_rate) AS avg_engagement_rate 
    FROM posts GROUP BY influencer_id
) p ON i.id = p.influencer_id
LEFT JOIN (
    SELECT influencer_id, COUNT(DISTINCT campaign) AS campaigns_participated, 
           SUM(revenue) AS total_revenue_generated, SUM(orders) AS total_orders_driven 
    FROM tracking_data GROUP BY influencer_id
) t ON i.id = t.influencer_id
LEFT JOIN (
    SELECT influencer_id, SUM(total_payout) AS total_earned 
    FROM payouts WHERE payment_status IN ('approved', 'processed', 'paid')
    GROUP BY influencer_id
) py ON i.id = py.influencer_id
WHERE i.is_active = TRUE;

-- 📈 View: Campaign ROAS (Return on Ad Spend)
CREATE OR REPLACE VIEW v_campaign_roas AS
SELECT 
    t.campaign,
    t.influencer_id,
    i.name AS influencer_name,
    i.tier,
    i.platform,
    SUM(t.revenue) AS campaign_revenue,
    COALESCE(MAX(py.total_payout), 0) AS campaign_cost,
    CASE 
        WHEN COALESCE(MAX(py.total_payout), 0) > 0 THEN ROUND(SUM(t.revenue) / MAX(py.total_payout), 2)
        ELSE 0 
    END AS roas,
    SUM(t.orders) AS total_orders,
    CASE 
        WHEN SUM(t.orders) > 0 THEN ROUND(MAX(py.total_payout) / SUM(t.orders), 2)
        ELSE 0 
    END AS cost_per_acquisition
FROM tracking_data t
JOIN influencers i ON t.influencer_id = i.id
LEFT JOIN (
    SELECT campaign, influencer_id, SUM(total_payout) AS total_payout
    FROM payouts WHERE payment_status IN ('approved', 'processed', 'paid')
    GROUP BY campaign, influencer_id
) py ON t.campaign = py.campaign AND t.influencer_id = py.influencer_id
GROUP BY t.campaign, t.influencer_id, i.name, i.tier, i.platform;

