DELIMITER $$

-- Auto-calculate tier based on follower count
CREATE TRIGGER tr_auto_update_tier
BEFORE UPDATE ON influencers
FOR EACH ROW
BEGIN
    IF NEW.follower_count <> OLD.follower_count THEN
        SET NEW.tier = CASE 
            WHEN NEW.follower_count >= 1000000 THEN 'Mega'
            WHEN NEW.follower_count >= 100000 THEN 'Macro'
            ELSE 'Micro'
        END;
    END IF;
END $$

-- Auto-update updated_at timestamp on status change
CREATE TRIGGER tr_auto_update_payouts
BEFORE UPDATE ON payouts
FOR EACH ROW
BEGIN
    IF NEW.payment_status <> OLD.payment_status THEN
        SET NEW.updated_at = CURRENT_TIMESTAMP;
    END IF;
END $$

DELIMITER ;

