ALTER TABLE influencers ADD CONSTRAINT chk_follower_tier
CHECK (
    (tier = 'Micro' AND follower_count < 100000) OR
    (tier = 'Macro' AND follower_count BETWEEN 100000 AND 999999) OR
    (tier = 'Mega' AND follower_count >= 1000000)
);

ALTER TABLE posts ADD CONSTRAINT chk_engagement_metrics
CHECK (
    likes >= 0 AND comments >= 0 AND shares >= 0 AND saves >= 0
);

ALTER TABLE tracking_data ADD CONSTRAINT chk_order_value_revenue
CHECK (
    revenue <= order_value * quantity
);




