-- View: Influencer's average engagement rate
CREATE OR REPLACE VIEW v_influencer_avg_engagement AS
SELECT 
    influencer_id,
    AVG(engagement_rate) AS avg_engagement_rate
FROM posts
GROUP BY influencer_id;





-- View: Incremental ROAS
CREATE OR REPLACE VIEW v_incremental_roas AS
SELECT 
    t.campaign,
    t.influencer_id,
    SUM(t.revenue) - SUM(CASE WHEN t.attribution_window > 14 THEN t.revenue ELSE 0 END) AS incremental_revenue,
    SUM(p.total_payout) AS total_cost,
    CASE 
        WHEN SUM(p.total_payout) > 0 THEN ROUND(SUM(t.revenue) / SUM(p.total_payout), 2)
        ELSE 0 
    END AS roas,
    SUM(t.orders) AS total_orders
FROM tracking_data t
JOIN influencers i ON t.influencer_id = i.id
LEFT JOIN payouts p ON t.campaign = p.campaign AND t.influencer_id = p.influencer_id
GROUP BY t.campaign, t.influencer_id;





-- View: Influencer Customer LTV
CREATE OR REPLACE VIEW v_influencer_ltv AS
SELECT 
    t.influencer_id,
    SUM(t.revenue) / COUNT(DISTINCT t.user_id) AS avg_lifetime_value
FROM tracking_data t
GROUP BY t.influencer_id;





