-- View: Campaign Revenue vs. Payouts
CREATE OR REPLACE VIEW v_campaign_revenue_vs_payouts AS
SELECT 
    t.campaign,
    SUM(t.revenue) AS total_revenue,
    SUM(p.total_payout) AS total_payout
FROM tracking_data t
LEFT JOIN payouts p ON t.campaign = p.campaign
GROUP BY t.campaign;



-- View: Best Performing Influencers (ROAS > 2)
CREATE OR REPLACE VIEW v_best_performing_influencers AS
SELECT 
    i.name AS influencer_name,
    SUM(t.revenue) AS total_revenue,
    SUM(p.total_payout) AS total_cost,
    ROUND(SUM(t.revenue) / SUM(p.total_payout), 2) AS roas
FROM tracking_data t
JOIN influencers i ON t.influencer_id = i.id
LEFT JOIN payouts p ON t.campaign = p.campaign AND t.influencer_id = p.influencer_id
GROUP BY t.influencer_id
HAVING roas > 2;





DELIMITER $$

CREATE TRIGGER before_insert_post_date
BEFORE INSERT ON posts
FOR EACH ROW
BEGIN
    IF NEW.post_date > CURRENT_DATE THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Post date cannot be in the future.';
    END IF;
END $$

DELIMITER ;


DELIMITER $$

CREATE TRIGGER before_insert_revenue
BEFORE INSERT ON tracking_data
FOR EACH ROW
BEGIN
    IF NEW.revenue < 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Revenue cannot be negative.';
    END IF;
END $$

DELIMITER ;


