CREATE VIEW v_influencer_total_payout AS
SELECT
    p.influencer_id,
    p.campaign,
    -- Calculate the total payout by summing the base rate, commission (based on revenue), and bonus amount
    (p.base_rate + (p.revenue_attributed * p.commission_rate) + p.bonus_amount) AS total_payout
FROM payouts p;


CREATE OR REPLACE VIEW v_campaign_performance_with_payouts AS
SELECT
    vcp.campaign,
    vcp.influencer_count,
    vcp.unique_customers,
    vcp.total_orders,
    vcp.total_revenue,
    vcp.avg_order_value,
    vcp.campaign_days,
    vcp.campaign_start,
    vcp.campaign_end,
    vcp.brand,
    -- Join the v_influencer_total_payout to include the total payout
    SUM(p.total_payout) AS total_payout
FROM v_campaign_performance vcp
JOIN v_influencer_total_payout p ON vcp.campaign = p.campaign
GROUP BY vcp.campaign, vcp.influencer_count, vcp.unique_customers, vcp.total_orders, vcp.total_revenue, vcp.avg_order_value, vcp.campaign_days, vcp.campaign_start, vcp.campaign_end, vcp.brand;



CREATE OR REPLACE VIEW v_post_performance AS
SELECT
    p.influencer_id,
    p.platform,
    p.post_date,
    p.caption,
    p.reach,
    p.impressions,
    p.engagement_rate,
    p.likes,
    p.comments,
    p.shares
FROM posts p
ORDER BY p.engagement_rate DESC;



CREATE OR REPLACE VIEW v_influencer_performance AS
SELECT
    i.id AS influencer_id,
    i.name AS influencer_name,
    COUNT(p.id) AS total_posts,
    AVG(p.engagement_rate) AS avg_engagement_rate,
    SUM(t.revenue) AS total_revenue_generated,
    SUM(t.orders) AS total_orders_driven,
    COUNT(DISTINCT t.campaign) AS campaigns_participated
FROM influencers i
JOIN posts p ON i.id = p.influencer_id
JOIN tracking_data t ON i.id = t.influencer_id
GROUP BY i.id, i.name
ORDER BY total_revenue_generated DESC;




CREATE VIEW v_top_influencers_by_revenue AS
SELECT influencer_name, total_revenue
FROM v_best_performing_influencers
ORDER BY total_revenue DESC
LIMIT 5;


CREATE VIEW v_top_personas_by_engagement AS
SELECT i.name AS influencer_name, v.avg_engagement_rate
FROM v_influencer_avg_engagement v
JOIN influencers i ON i.id = v.influencer_id
ORDER BY v.avg_engagement_rate DESC
LIMIT 5;



CREATE VIEW v_poor_roi AS
SELECT 
    i.name AS influencer_name, 
    v.campaign, 
    v.incremental_revenue AS total_revenue, 
    v.total_cost, 
    v.roas, 
    v.total_orders
FROM v_incremental_roas v
JOIN influencers i ON i.id = v.influencer_id
WHERE v.roas < 1.5  -- Example threshold for poor ROI
ORDER BY v.roas ASC
LIMIT 5;


